import './styles/Home.css';

const Account = () => {
  return (
    <div className="container">
      <div className="wrapper-ac">
        <h1>Login</h1>
        <input type="text" placeholder="@username" />
        <input type="text" placeholder="password" />
        <button>Login</button>
        <button>Login</button>
        <p>*click here to register</p>
